import {makeAutoObservable} from "mobx"

export default class bankStore {
    constructor() {
        // TODO Add cards, transactions
        this._banks = []
        makeAutoObservable(this);
    }

    setItems(items) {
        this._items = items;
    }
    
    get banks() {
        return this._banks;
    }
}
